    'about.AboutText1': 'OLX is the world\u2019s leading classifieds platform focused in emerging markets, both mobile and online',
    'about.AboutText2': 'OLX \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0441\u0432\u0456\u0442\u043E\u0432\u043E\u043C\u0443 \u0440\u0456\u0432\u043D\u0456, \u0431\u0456\u043B\u044C\u0448 \u043D\u0456\u0436 \u0432 40 \u043A\u0440\u0430\u0457\u043D\u0430\u0445 \u0441\u0432\u0456\u0442\u0443',
    'about.about_Body': '<p>"OLX" - \u0446\u0435 \u0441\u0430\u0439\u0442 \u0431\u0435\u0437\u043A\u043E\u0448\u0442\u043E\u0432\u043D\u0438\u0445 \u043E\u043D\u043B\u0430\u0439\u043D-\u043E\u0433\u043E\u043B\u043E\u0448\u0435\u043D\u044C \u043D\u043E\u0432\u043E\u0433\u043E \u043F\u043E\u043A\u043E\u043B\u0456\u043D\u043D\u044F.<br /><br />\u0421\u0430\u0439\u0442 "OLX" \u043F\u0440\u043E\u043F\u043E\u043D\u0443\u0454 \u043F\u0440\u043E\u0441\u0442\u0435 \u0440\u0456\u0448\u0435\u043D\u043D\u044F \u0443\u0441\u0456\u0445 \u043F\u0440\u043E\u0431\u043B\u0435\u043C, \u0449\u043E \u0441\u0443\u043F\u0440\u043E\u0432\u043E\u0434\u0436\u0443\u044E\u0442\u044C \u0437\u0430\u0440\u0430\u0437 \u043F\u0440\u043E\u0434\u0430\u0436, \u043F\u043E\u043A\u0443\u043F\u043A\u0443, \u0430 \u0442\u0430\u043A\u043E\u0436  \u043E\u0431\u0433\u043E\u0432\u043E\u0440\u0435\u043D\u043D\u044F \u0446\u0456\u043D \u0442\u0430 \u0443\u043C\u043E\u0432 \u0443\u0433\u043E\u0434\u0438, \u043D\u0435\u0437\u0430\u043B\u0435\u0436\u043D\u043E \u0432\u0456\u0434 \u043C\u0456\u0441\u0446\u044F \u0412\u0430\u0448\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u043D\u044F.<br /><br />\u0421\u0430\u0439\u0442 "OLX" \u0434\u043E\u0437\u0432\u043E\u043B\u044F\u0454:<br /><ul><li>\u041B\u0435\u0433\u043A\u043E \u0441\u0442\u0432\u043E\u0440\u044E\u0432\u0430\u0442\u0438 \u0431\u0430\u0433\u0430\u0442\u0443 \u0440\u0435\u043A\u043B\u0430\u043C\u0443 \u0437 \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0456\u044F\u043C\u0438.</li><li>\u041A\u043E\u043D\u0442\u0440\u043E\u043B\u044E\u0432\u0430\u0442\u0438 \u043F\u0440\u043E\u0434\u0430\u0436, \u043F\u043E\u043A\u0443\u043F\u043A\u0438 \u0442\u0430 \u0441\u0443\u0441\u043F\u0456\u043B\u044C\u043D\u0443 \u0434\u0456\u044F\u043B\u044C\u043D\u0456\u0441\u0442\u044C \u0443 \u0440\u043E\u0437\u0434\u0456\u043B\u0456 "\u041C\u0456\u0439 OLX".</li><li>\u0412\u0456\u0434\u043E\u0431\u0440\u0430\u0436\u0430\u0442\u0438 \u043E\u0433\u043E\u043B\u043E\u0448\u0435\u043D\u043D\u044F \u043D\u0430 \u0412\u0430\u0448\u0456\u0439 \u0441\u0442\u043E\u0440\u0456\u043D\u0446\u0456 \u0443 \u0441\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u0438\u0445 \u043C\u0435\u0440\u0435\u0436\u0430\u0445 (Facebook, Myspace, ...).</li><li>\u0412\u0456\u0434\u0432\u0456\u0434\u0443\u0432\u0430\u0442\u0438 \u043D\u0430\u0448 \u0441\u0430\u0439\u0442 \u0437 \u043C\u043E\u0431\u0456\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u0443.</li><li>\u0412\u0456\u0434\u043E\u0431\u0440\u0430\u0436\u0430\u0442\u0438 \u0441\u0430\u0439\u0442 "OLX" \u0412\u0430\u0448\u043E\u044E \u043C\u043E\u0432\u043E\u044E.</li></ul><br />\u0421\u0430\u0439\u0442 "OLX" \u0456\u0441\u043D\u0443\u0454 \u0431\u0456\u043B\u044C\u0448 \u043D\u0456\u0436 \u0443 <<QTY_COUNTRIES>> \u043A\u0440\u0430\u0457\u043D\u0430\u0445, \u0439\u043E\u0433\u043E \u043F\u0435\u0440\u0435\u043A\u043B\u0430\u0434\u0435\u043D\u043E <<QTY_LANGUAGES>> \u043C\u043E\u0432\u0430\u043C\u0438. "OLX" - \u0446\u0435 \u043F\u0440\u0438\u0432\u0430\u0442\u043D\u0430 \u043A\u043E\u043C\u043F\u0430\u043D\u0456\u044F, \u044F\u043A\u0443 \u0431\u0443\u043B\u043E \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u043E \u0443 \u0431\u0435\u0440\u0435\u0437\u043D\u0456 2006 \u0440.</p>',
